description:
Nr nyheten om prinsessan Dianas dod nar ett chockat brittiskt folk, 
drar sig drottning Elisabeth II sig tillbaka med sin familj, utan att forsta
allmanhetens reaktion pa tragedin.
For Tony Blair, den populare och nyvalde premiarministern, ar folkets
behov av trost och stod  fran nationen uppenbar.
Allt eftersom tiden gar okar misstron och Blair maste hitta en losning
att aterforena drottningen med det brittiska folket...
